import React from 'react'
import ScoreChart from './ScoreChart'
import BackgroundImagePage from './BackgroundImage'

const Home = props => {

    return(
        <div className="home">
            <div>
                <BackgroundImagePage />
            </div>
            <div className="homepage-box" onClick={()=>{props.history.push(`MultipleChoice`)}}>
                <h3>Quizzes</h3>
                <p>Learn through answering multiple choice questions</p>
            </div>
            <div className="homepage-box" onClick={()=>{props.history.push(`Speak`)}}>
                <h3>Alphabet</h3>
                <p>Learn the Alphabet</p>
            </div>
            <div className="homepage-box" onClick={()=>{props.history.push(`PuzzleGame`)}}>
                <h3>Puzzle</h3>
                <p>Put the puzzle back together</p>
            </div>
            <div className="homepage-box" onClick={()=>{props.history.push(`Flashcards`)}}>
                <h3>Flashcards</h3>
                <p>Look over your Flashcards or Create new ones</p>
            </div>
            <div className="homepage-box" onClick={()=>{props.history.push(`Scores`)}}>
                <h3>Scores</h3>
                <p>Look back at how you scored</p>
            </div>
        </div>
    )
}

